import React, { useState } from 'react'
import {auth,SignInGoogle} from "./config/firebase"
import { signInWithPopup, signOut } from 'firebase/auth'
import './App.css';

const Profile = () => {


    const [profile,setProfile]=useState("")

const SignIn=async () =>{

    try {
            await signInWithPopup(auth,SignInGoogle)

    } catch (err) {
        console.error(err)
    }


}
const SignOut=async () =>{
    try {
        await signOut(auth)

    } catch (err) {
        console.error(err)
    }


}




  return (
    <div>

        <img src={profile} />
    <button onClick={SignIn} onChange={(e)=>{setProfile(auth.currentUser.profile)}}>Sign In</button>
    <button onClick={SignOut}>Sign Out</button>



    </div>
  )
}

export default Profile
